import React from 'react';
import Calculator from '../calculator/Calculator';

const Projects = () => (
  <div>
    <h2>Projects</h2>
    <p>
      Here are some of my projects including web applications and software solutions.
    </p>
    <div>
      <h3>Calculator Project</h3>
      <Calculator />
    </div>
  </div>
);

export default Projects;
